import React from "react";
import HomeNavBar from "../components/HomeNavBar";

function HomePage() {
  return (
    <div>
      <HomeNavBar />
      <div className="flex justify-center items-center h-screen">
        <div>
          <p className="md:italic">Discover Your Next Favorite Movie</p>
          <h2 className="text-6xl">
            The best way to find <br /> your next movie.
          </h2>
          <h4>
            Get personalized recommendations based on your preferences. <br />
            Collaborate with a partner to choose the perfect film for any <br />
            occasion. Explore movies tailored to your tastes and interests.
          </h4>
        </div>
      </div>
    </div>
  );
}

export default HomePage;
